/* eslint-disable */
import React, { useState } from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import {  Button, CardTitle, CardText, Row, Col,UncontrolledDropdown, 
    Label,FormGroup,Input,Form,FormText,
    DropdownToggle, DropdownMenu, DropdownItem, ButtonGroup} from 'reactstrap';
import { Container, NavbarBrand, Navbar, Nav, NavItem, NavbarToggler, Collapse } from 'reactstrap';

import logo from '../../assets/images/logos/vaxicon-removebg-preview.png';

const Header = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    /*--------------------------------------------------------------------------------*/
    /*To open NAVBAR in MOBILE VIEW                                                   */
    /*--------------------------------------------------------------------------------*/

    return (
        <div className="topbar" id="top">
            <div className="header6">
                <Container className="po-relative">
                    <Navbar className="navbar-expand-lg h6-nav-bar">
                        <NavbarBrand href="/"><img src={logo} alt="wrapkit" height="100"/></NavbarBrand>
                        <NavbarToggler onClick={toggle}><span className="ti-menu"></span></NavbarToggler>
                        <Collapse isOpen={isOpen} navbar className="hover-dropdown font-14 ml-auto" id="h6-info">
                            <Nav navbar className="ml-auto">
                                {/* <NavItem>
                                    <Link className="nav-link" to={"/components"}>
                                        Components
										</Link>
                                </NavItem>
                                <NavItem>
                                    <Link className="nav-link" to={"/custom-components"}>
                                        Custom-Components
                                    	</Link>
                                </NavItem> */}
                            </Nav>
                            {/* <div className="act-buttons">
                                <Link to="/#coming" className="btn btn-success-gradiant font-14">Upgrade To Pro</Link>
                            </div> */}
                        </Collapse>
                    </Navbar>
                </Container>
                <ButtonGroup>{' '}
                            <UncontrolledDropdown setActiveFromChild>
                                <DropdownToggle tag="button" className="btn btn-secondary" caret>
                                    Search By Pin
                                </DropdownToggle>
                                <DropdownMenu>
                                    <DropdownItem tag="a" href="/blah">Search By Pin</DropdownItem>
                                    <DropdownItem tag="a" href="/blah">Search By District</DropdownItem>
                                </DropdownMenu>
                            </UncontrolledDropdown>
                        </ButtonGroup>   
            </div>
        </div>
    );

}
export default Header;
